import React, { Component } from 'react';



const DNA = ( props ) => {

    return (
        <div>
            <p>Name: {this.props.name}</p>
            <p>Description: {this.props.description}</p>
            <p>Sequence: {this.props.sequence}</p>
        </div>
    );
};

export default DNA;
